Nothing but the Beat is the fifth studio album by French disc jockey and record producer David Guetta, released on August 26, 2011. Released as a double album, the first disc features collaborations with artists from the R&amp;B, hip hop and pop worlds such as Lil Wayne, Taio Cruz, Nicki Minaj, Ludacris, Snoop Dogg, Afrojack, Chris Brown, Flo Rida, Usher, Jennifer Hudson, Dev, Timbaland, Jessie J and Sia Furler. Also making appearances are Will.i.am, Akon and Ne-Yo, all three of whom previously collaborated with Guetta on his fourth album, One Love.The album has thus far spawned four singles which attained success on the US Hot 100 Ã¢â‚¬â€œ &quot;Where Them Girls At&quot;, &quot;Without You&quot;, &quot;Turn Me On&quot; and &quot;Titanium&quot; Ã¢â‚¬â€œ becoming his third, fourth, fifth and sixth top 20 singles, respectively. On November 30, 2011, the album received a nomination for Grammy Award for Best Dance/Electronica Album at the 54th Grammy Awards.The album was then re-released on September 7, 2012 under the name, Nothing but the Beat 2.0.[4] It includes six new tracks including lead single &quot;She Wolf (Falling to Pieces)&quot;, which features Sia, who previously collaborated with Guetta on &quot;Titanium&quot;. The remixes of this single were released exclusively through Beatport on August 7, 2012. Several tracks from the original album have been removed from the re-release, however all the singles have been retained.

